The passport's keys are to maintain the state of the passport's chain. Other protocols or interactions may requires to have other kind of entries set in the passport's chain. Here we defines the passport's SharedKey . It is a key that is encrypted for every other passport's key. Every time a SharedKey is register it deprecates the use of the previously declared _SharedKey_s. The SharedKey are encrypted using the Npsk0 pattern of the noise protocol. This allows to encrypt the data in such a way that only the recipient of the key can retrieve the SharedKey if they also know the pre shared key . let psk = ; // 32 bytes of pre shared key
